	<p>–ò —è –ø–æ–≤–µ—Ä–∏–ª–∞,—á—Ç–æ —Ç–∞–∫–æ–µ –º–æ–∂–µ—Ç –±—ã—Ç—å. –ù–æ,—Ç—É—Ç –∂–µ —Ç–∞–∫ –∂–µ—Å—Ç–æ–∫–æ –≤—Å—ë –∑–∞–±—Ä–∞–ª–∞. –ò —Å–Ω–æ–≤–∞ —Å—Ç–∞–ª–∞ –¥—É—à—É –æ–¥–∏–Ω–æ—á–µ—Å—Ç–≤–æ–º —Ç—Ä–∞–≤–∏—Ç—å! –ò –º–Ω–µ –≤–Ω–æ–≤—å –ø—Ä–∏—Ö–æ–¥–∏—Ç—å—Å—è –º–∏—Ä–∏—Ç—å—Å—è –° –≥–æ—Ä—å–∫–æ–π —É—á–∞—Å—Ç—å—é —Å–≤–æ–µ–π. –Ø —Ç–∞–∫ —Ö–æ—á—É —Å –§–∞—Ç—É–º–æ–º —Å—Ä–∞–∑–∏—Ç—å—Å—è. –ù–æ,–µ–≥–æ —Ä—É–∫–∞ - –∑–Ω–∞—á–∏—Ç–µ–ª—å–Ω–æ —Å–∏–ª—å–Ω–µ–π! –û –ë–æ–∂–µ –∫—É–¥–∞ –º—ã –≤—Å–µ –∏–¥—ë–º? –ò –∫–∞–∫ –Ω–∞–º –¥–∞–ª—å—à–µ –∂–∏—Ç—å? –ï—Å–ª–∏ —Ç–µ—Ö —ç–≥–æ–∏—Å—Ç–∞–º–∏ –∑–æ–≤—ë–º, –ö—Ç–æ —Å—á–∞—Å—Ç–ª–∏–≤—ã–º —Ö–æ—á–µ—Ç –±—ã—Ç—å?!</p>
<p>–ù—É –ø–æ—á–µ–º—É –∫–æ–≥–¥–∞ —Ç—ã —Ö–æ—á–µ—à—å, –° –ª—é–±–∏–º—ã–º —á–µ–ª–æ–≤–µ–∫–æ–º –∂–∏—Ç—å. –¢–æ —Å–ª—ã—à–∏—à—å,—á—Ç–æ —ç—Ç–æ–≥–æ –Ω–µ —Å–º–æ–∂–µ—à—å. –ò –æ–Ω —Å–∞–º —Ç–µ–±–µ —ç—Ç–æ –≥–æ–≤–æ—Ä–∏—Ç?! –ò –Ω–∞—Ö–æ–¥–∏—Ç —Ä–∞–∑–Ω—ã–µ –ø—Ä–µ–¥–ª–æ–≥–∏, –ß—Ç–æ –Ω–µ –ø–æ–π–º—É—Ç —Ä–æ–¥–∏—Ç–µ–ª–∏,–¥—Ä—É–∑—å—è. –¢–∞–∫,–∏–∑-–∑–∞ –±–æ—è–∑–Ω–∏ —Å–ø–æ—Ç–∫–Ω—É—Ç—å—Å—è –æ –º–æ—Ä–∞–ª—å–Ω—ã–µ –ø–æ—Ä–æ–≥–∏, –ú–æ–∂–µ—Ç –Ω–µ —Å–ª–æ–∂–∏—Ç—å—Å—è —Å—á–∞—Å—Ç–ª–∏–≤–∞—è —Å–µ–º—å—è! –ù—É –ø–æ—á–µ–º—É —Å –∏–Ω–≤–∞–ª–∏–¥–æ–º –∂–∏—Ç—å –±–æ—è—Ç—Å—è? –ò –Ω–µ –ø—Ä–∏–Ω–∏–º–∞—é—Ç –µ–≥–æ –≤—Å–µ—Ä—å—ë–∑? –í –ª—é–±–æ–≤—å —Å –Ω–∏–º - –º–æ–≥—É—Ç –ø–æ–∏–≥—Ä–∞—Ç—å—Å—è. –ò —ç—Ç–∏–º,–Ω–µ –¥—É–º–∞—è,–¥–æ–≤–æ–¥—è—Ç –¥–æ —Å–ª—ë–∑?! –í –¥–µ—Ä–µ–≤–Ω–µ —Å—Ç–∞—Ä—É—à–∫–∞ –æ—Å—Ç–∞–ª–∞—Å—å –≤–¥–æ–≤–æ–π, –ò –Ω–µ —Å –∫–µ–º —Ç–µ–ø–µ—Ä—å –ø–æ–¥–µ–ª–∏—Ç—å—Å—è –±–µ–¥–æ–π, –ê –¥–µ—Ç–∏ —Ä–∞–∑—ä–µ—Ö–∞–ª–∏—Å—å –≤—Å–µ –ø–æ –¥–æ–º–∞–º, –°–∫–∞–∑–∞–≤ –º–µ–∂–¥—É –ø—Ä–æ—á–∏–º "–ü–æ–µ—Ö–∞–ª–∏ –∫ –Ω–∞–º –ü–æ–∫–∞–∑–∞—Ç—å –ø–æ–ª–Ω–æ—Å—Ç—å—é –¢—ã –¥–æ–º–∏–∫ –ø—Ä–æ–¥–∞–π –∏ —Ö–æ–∑—è–π—Å—Ç–≤–æ —Å–≤–æ–µ, –£ –Ω–∞—Å –±—É–¥–µ—à—å –∂–∏—Ç—å, –º—ã –∏–º–µ–µ–º –∂–∏–ª—å–µ, –¢–µ–±–µ —Å–æ–∑–¥–∞–¥–∏–º –º—ã —Ö–æ—Ä–æ—à–∏–π —É—é—Ç, –ù–µ –Ω—É–∂–µ–Ω —Ç–µ–±–µ –∫–∞–∑–µ–Ω–Ω—ã–π –ø—Ä–∏—é—Ç" –ü–æ—Å–ª—É—à–∞–ª–∞ –º–∞–º–∞ –∏ –≤—Å–µ –ø—Ä–æ–¥–∞–ª–∞, –ê –¥–µ–Ω—å–≥–∏ –ø–æ–¥–∞–ª—å—à–µ –æ–Ω–∞ —É–±—Ä–∞–ª–∞: "–Ø –∏—Ö –∏—Å–ø—ã—Ç–∞—é,–ø–æ–¥—É–º–∞–ª–∞ –º–∞—Ç—å, –ü–æ–∫–∞ —á—Ç–æ –ø—Ä–æ –¥–µ–Ω—å–≥–∏ —è –±—É–¥—É –º–æ–ª—á–∞—Ç—å" –†–µ—à–∏–ª–∞ —Å –æ—Ç–¥–∞—á–µ–π –∏—Ö –Ω–µ —Å–ø–µ—à–∏—Ç—å: "–ö–∞–∫ –º–∞—Ç—å —è —Å–º–æ–≥—É –∏ –±–µ–∑ –¥–µ–Ω–µ–≥ –ø—Ä–æ–∂–∏—Ç—å?</p>
